import { Config } from './../../src/configue';

export default function () {
  var pages = [
    {
      title: "agTEK",
      htmlBefore: '<i class="material-icons"></i>',
      to: "/main",
    },

    {
      title: "Vaches & Groupes ",
      htmlBefore: '<i class="material-icons"></i>',
      to: "/Vaches",
    },
    {
      title: "Regime & Fooder",
      htmlBefore: '<i class="material-icons"></i>',
      to: "/regime",
    },
    {
      title: "DAC",
      htmlBefore: '<i class="material-icons"></i>',
      to: "/DAC",
    },
    {
      title: "Profile",
      htmlBefore: '<i class="material-icons"></i>',
      to: "/Profile",
    },
    {
      title: "Statistique",
      htmlBefore: '<i class="material-icons"></i>',
      to: "/Statistique",
    },
    {
      title: "Log",
      htmlBefore: '<i class="material-icons"></i>',
      to: "/Log",
    },
    {
      title: "User",
      htmlBefore: '<i class="material-icons"></i>',
      to: "/User",
    },
    {
      title: "Errors",
      htmlBefore: '<i class="material-icons"></i>',
      to: "/errors",
    }

  ]
  var localPages = [
    {
      title: "form ahmed",
      htmlBefore: '<i class="material-icons">table_chart</i>',
      to: "/forms",
    },
    {
      title: "Blog Posts",
      htmlBefore: '<i class="material-icons">vertical_split</i>',
      to: "/blog-posts",
    },
    {
      title: "Add New Post",
      htmlBefore: '<i class="material-icons">note_add</i>',
      to: "/add-new-post",
    },
    {
      title: "Blog Dashboard",
      to: "/blog-overview",
      htmlBefore: '<i class="material-icons">edit</i>',
      htmlAfter: ""
    },
    {
      title: "Forms & Components",
      htmlBefore: '<i class="material-icons">view_module</i>',
      to: "/components-overview",
    },

    {
      title: "User Profile",
      htmlBefore: '<i class="material-icons">person</i>',
      to: "/user-profile-lite",
    },

  ]
  if (Config.url == "http://localhost:4000") {
    for (let i = 0; i < localPages.length; i++) {
      pages.push(localPages[i])
    }

  }
  return (pages);
}
